import React from 'react'
import { Button, List } from 'antd';
import { UserOutlined } from '@ant-design/icons';



const BookingCardAntd = (props) => {
    const listData = props.myBooking;

    return (
        <List
            itemLayout="vertical"
            size='default'
            style={{
                width:'100%',
            }}
            dataSource={listData}
            renderItem={item => (
                <List.Item>
                    <div>
                        <div>
                            {item.restaurant}
                        </div>
                    </div>
                </List.Item>
            )}
        />
    )
}

export default BookingCardAntd
